// Portfolio.js
import React, { useContext } from 'react';
import { AppContext } from '../AppContext'; // Assuming you have an AppContext

import NavbarCasual from '../NavBar/NavbarCasual';
import NavbarProfessional from '../NavBar/NavbarProfessional';


const Portfolio = () => {
  const { isProfessional } = useContext(AppContext);

  return (
    <div>
      {/* Render the appropriate navbar based on the context */}
      {isProfessional ? <NavbarProfessional /> : <NavbarCasual />}

      <h1>Portfolio Page</h1>
      {/* Add your portfolio content here */}
    </div>
  );
};

export default Portfolio;
